2	1	3	Utilitarianism is a consequentialist lens in which the decision that produces the greatest happiness is the morally correct thing to do. Jeremy Bentham was the first to articulate the hedonic calculusa means to measure and weigh pleasure which he defined as happiness, against pain, which he defined as unhappiness. Crucial to this type of analysis is that no one persons or groups happiness should be given more weight than any other. It is an equal consideration of everyones <em>unranked</em> interests. <a href="https://sleepyclasses.com/wp-content/uploads/2022/04/Jeremy-Benthams-Utilitarianism-Theory.pdf">Click here to learn more!</a>\n
3	1	4	John Stuart Mill refined Benthams theory by adding an evaluation of higher and lower pleasures. Outcomes that are earned honestly and deserved result in higher pleasures than the opposite. For example, you can get money by stealing it or working for it. The pleasure you get from earning it is higher than the pleasure you might get if you steal it. Run the calculus again, but this time, give higher pleasures more weight. <a href="https://iep.utm.edu/mill-eth/">Click here to learn more!</a>\n
4	1	16	According to Kant, we reason our way to understanding what moral law should govern our decisions. Kant called these moral laws categorical (universal, timeless) imperatives (must dos that are not optional). <a href="https://en.wikipedia.org/wiki/Categorical_imperative">Click here to learn more!</a>\n
5	1	8	Ethical decision-making often involves considering how the situation came about, the\n          history of events that led to the need for action. Some duties are based on past actions.\n          Does the past impose moral duties of fidelity, reparation, or gratitude in this case? <a href="https://sevenpillarsinstitute.org/ethics-101/kantian-duty-based-deontological-ethics/">Click here to learn more!</a>\n
